class Msession(HTMLSession):

    def __init__(self, nproxy=False):
        super(Msession, self).__init__()
        if nproxy:
            self.get_proxy = get_proxy
            self.set_proxy()
        self.headers = {
            'User-Agent': ua()
        }

    def set_proxy(self):
        p = self.get_proxy()
        log.info("Msession set proxy=%s", p)
        self.proxies = {
            'http': 'socks5://' + p,
            'https': 'socks5://' + p
        }

